import { TodoCount } from './todosComp/TodoCount';
import { CreateTodoButton } from './todosComp/CreateTodosButton';
import { TodoSearch } from './todosComp/TodoSearch';
import './App.css';

function App() {
  //JSX
  return (
    <div className="App">
      <TodoCount/>
      <TodoSearch/>    
      <TodoList>
      <TodoItem
  total={5}/>
      </TodoList>  
        
    <CreateTodoButton/>
    </div>
  );
}

function TodoItem (pro)
{
  return (
    <li>
       <span>{pro.total}</span>
       <p> hola mundo </p>
       <span>X</span>
    </li>
  );
}

export default App;
